class solution:
    def longest_substring(self,s:str) ->int:
        a=""
        i=0
        while i<len(s):
            b=""
            j=0
            while j<len(s[i:]):
                if s[i:][j] not in b:
                    b+=s[i:][j]
                    j+=1
                else:
                    break
            if len(b)>len(a) and b in s:
                a=b
            i+=1                                        
        return a,len(a)

